import React from 'react';

class GoodTheyAreDoing extends React.Component {
    render() {
        return (
            <div className="jumbotron">
            <h1 className="display-4">Good They Are Doing </h1>
            <img src="images/redFlowers.jpg" class="ui fluid image" />
            <p className="lead">This is a simple hero unit, a simple jumbotron-style component for calling extra attention to featured content or information.</p>
            <hr className="my-4"></hr>
            <p>It uses utility classes for typography and spacing to space content out within the larger container.</p>
            <a className="btn btn-primary btn-lg" href="/responsibility" role="button">Learn more</a>
          </div>
        )
    }
};

export default GoodTheyAreDoing;
